const express = require("express");
const mongoose = require("mongoose");
const app = express();
const connectionString = require("./config/keys").mongoURI;
require("./MongoSchemas/genres");
require("./MongoSchemas/performerAccount");
require("./MongoSchemas/performerContent");
require("./MongoSchemas/user");
mongoose.connect(connectionString);
const PORT = 5000;

const Genre = mongoose.model("genres");
const User = mongoose.model("users");
const PerformerAccount = mongoose.model("performerAccount");
app.get("/api/musicians", (req, res) => {
  User.find({}, function(err, users) {
    var musicians = [];

    users.forEach(function(user) {
      if (user.isPerformer == true) {
        musicians.push(user);
      }
    });

    res.json(musicians);
  });
});

app.get("/api/home", (req, res) => {
  Genre.find({}, (err, genres) => {
    var genreMap = {};
    genres.forEach(genre => {
      genreMap[genre._id] = genre;
    });

    res.json(genres);
  });
});

